import React from 'react';


function ToDoList ({ToDoList}){

    return (
        <div>
            <h1>To Do List</h1>
            {ToDOList.map(todo => {
                <div key={todo.id}>
                    <h2>Heading: {todo.name}</h2>
                </div>
            })}
        </div>
    )
}

export default ToDoList;
